const express = require('express');
const app = express();
const axios = require('axios');
const FormData = require('form-data');
const fs = require('fs');
const _formData = new FormData();

app.post('/criar-documento', (req, res) => {
  
  //console.log(Buffer.from("Hello World").toString('base64'));

  let arq = Buffer.from("", 'base64');
 
  /**
   * 
   * Adicionar parâmetros:
   * Titulo
   * emails
   * arquivo
   * sandbox - true / false
   * 
   */
  let titulo = 'Teste de contrato';
  let emails = '[{"email": "mateusbonet@yahoo.com.br","action": "SIGN"}]';

  _formData.append('operations', '{"query":"mutation CreateDocumentMutation($document: DocumentInput!, $signers: [SignerInput!]!, $file: Upload!) {createDocument(sandbox: true, document: $document, signers: $signers, file: $file) {id name refusable sortable created_at signatures { public_id name email created_at action { name } link { short_link } user { id name email }}}}", "variables":{"document": {"name": "' + titulo + '"},"signers": ' + emails + ',"file":null}}');
  _formData.append('map', '{"file": ["variables.file"]}');
  //_formData.append('file', fs.createReadStream('/Users/mateusbonet/Downloads/1633366791391(1) (1) (1).pdf'));
  _formData.append('file', arq);

  var config = {
    method: 'post',
    url: 'https://api.autentique.com.br/v2/graphql',
    headers: { 
        'Authorization': req.headers.authorization, 
      ..._formData.getHeaders()
    },
    data : _formData
  };

  axios(config)
  .then(function (response) {
    res.json({status: 'sucesso', mensagme: response.data})
  })
  .catch(function (error) {
    res.json({status: 'erro', mensagem: error })
  });
  
})

app.get('/resgatar-documento', (req, res) => {

  var axios = require('axios');
  var data = JSON.stringify({
    "query": "query { document(id: \"772594e1d4a5bdc13cac8e8305a789e57ec8bb5935b3bffd1\") { id name refusable sortable created_at files { original signed } signatures { public_id name email created_at action { name } link { short_link } user { id name email } email_events { sent opened delivered refused reason } viewed { ...event } signed { ...event } rejected { ...event } } } } fragment event on Event { ip port reason created_at geolocation { country countryISO state stateISO city zipcode latitude longitude } }",
  "variables": {}
  });

  var config = {
    method: 'post',
    url: 'https://api.autentique.com.br/v2/graphql',
    headers: { 
     'Authorization': res.headers.authorization, 
     'Content-Type': 'application/json'
    },
    data : data
  };

  axios(config)
  .then(function (response) {
    res.json({ status: "sucesso", mensagem: response.data });
  })
  .catch(function (error) {
    res.status(500).json({ status: "erro", mensagem: error });
  });

  })

app.listen(80, function () {
  console.log('API template iniciado porta: 80')
})